import React  from 'react';
import { Link } from 'react-router-dom';

const Nav = () => {
    return (
    <nav className="navbar bg-primary">
        <h5>
        <i class="fab fa-wolf-pack-battalion"></i> &nbsp;
        My CMS
        </h5>
       <Link to="/about" >About</Link>
       <Link to="/" >Home</Link>
    </nav>
    )
}

export default Nav
